
import jsPDF from 'jspdf';
import { Sale } from '@/hooks/useSales';
//import { Purchase } from '@/hooks/usePurchases';

const logoBase64 = 'data:image/png;base64,'; // e.g., PNG Base64 string

interface PurchaseItem {
  productName: string;
  quantity: number;
  unitPrice: number;
  totalAmount: number;
}

interface PurchaseForPDF {
  id: string;
  productId: string;
  productName: string;
  supplier: string;
  quantity: number;
  unitPrice: string;
  totalAmount: string;
  date: string;
  status: string;
  notes?: string;
  purchaseOrderId?: string;
  items?: PurchaseItem[];
}
export const generateSalesInvoicePDF = (sale: Sale) => {
  const doc = new jsPDF();
  // Add logo
  doc.addImage(logoBase64, 'PNG', 10, 10, 25, 25); // x, y, width, height
  // Header
  doc.setFontSize(20);
  doc.text('SALES INVOICE', 105, 20, { align: 'center' });
  
  // Company info (you can customize this)
  doc.setFontSize(12);
  doc.text('Nahar Enterprise', 20, 40);
  doc.text('Abdul Kadar market, member bari road,', 20, 50);
  doc.text('National University, gazipur city corporation.', 20, 60);
  doc.text('Phone: 01712014171', 20, 70);
  
  // Invoice details
  doc.text(`Invoice ID: ${sale.id}`, 120, 40);
  doc.text(`Date: ${new Date(sale.date).toLocaleDateString()}`, 120, 50);
  doc.text(`Status: ${sale.status}`, 120, 60);
  
  // Customer info
  if (sale.customerName) {
    doc.text('Bill To:', 20, 90);
    doc.text(sale.customerName, 20, 100);
  }
  
  // Table headers
  doc.setFontSize(10);
  doc.text('Product', 20, 120);
  doc.text('Quantity', 80, 120);
  doc.text('Unit Price', 120, 120);
  doc.text('Total', 160, 120);
  
  // Draw line under headers
  doc.line(20, 125, 190, 125);
  
  // Product details
  doc.text(sale.productName, 20, 135);
  doc.text(sale.quantity.toString(), 80, 135);
  doc.text(sale.unitPrice, 120, 135);
  doc.text(sale.totalAmount, 160, 135);
  
  // Total section
  doc.line(20, 145, 190, 145);
  doc.setFontSize(12);
  doc.text(`Total Amount: ${sale.totalAmount}`, 120, 160);
  
  // Notes
  if (sale.notes) {
    doc.setFontSize(10);
    doc.text('Notes:', 20, 180);
    doc.text(sale.notes, 20, 190);
  }
  
  // Footer
  doc.setFontSize(8);
  doc.text('Thank you for your business!', 105, 270, { align: 'center' });
  
  // Save the PDF
  doc.save(`sales-invoice-${sale.id}.pdf`);
};
export const generatePInvoicePDF = (purchase: PurchaseForPDF) => {
  const doc = new jsPDF();

  // Add logo
  doc.addImage(logoBase64, 'PNG', 10, 10, 25, 25);

  // Header
  doc.setFontSize(20);
  doc.text('PURCHASE ORDER', 105, 20, { align: 'center' });

  // Company info
  doc.setFontSize(12);
  doc.text('Nahar Enterprise', 20, 40);
  doc.text('Abdul Kadar market, member bari road,', 20, 50);
  doc.text('National University, gazipur city corporation.', 20, 60);
  doc.text('Phone: 01712014171', 20, 70);

  // Purchase order details
  doc.text(`Purchase Order ID: ${purchase.id}`, 120, 40);
  doc.text(`Date: ${new Date(purchase.date).toLocaleDateString()}`, 120, 50);
  doc.text(`Status: ${purchase.status}`, 120, 60);

  // Supplier info
  doc.text('Supplier:', 20, 90);
  doc.text(purchase.supplier, 20, 100);

  // Table headers
  doc.setFontSize(10);
  doc.text('Product', 20, 120);
  doc.text('Quantity', 80, 120);
  doc.text('Unit Price', 120, 120);
  doc.text('Total', 160, 120);

  // Draw line under headers
  doc.line(20, 125, 190, 125);

  // Product details
  let yPosition = 135; // Start position for product rows
  if (purchase.items && purchase.items.length > 0){
    purchase.items.forEach((item: any) => {
    doc.text(item.productName, 20, yPosition);
    doc.text(item.quantity.toString(), 80, yPosition);
    doc.text(`${item.unitPrice}`, 120, yPosition);
    doc.text(`${item.totalAmount}`, 160, yPosition);
    yPosition += 10; // Move down for next item
  });
  }
  else{
     // Handle single item (fallback)
    doc.text(purchase.productName, 20, yPosition);
    doc.text(purchase.quantity.toString(), 80, yPosition);
    doc.text(purchase.unitPrice, 120, yPosition);
    doc.text(purchase.totalAmount, 160, yPosition);
    
    yPosition += 20;
  }
  

  // Total section
  doc.line(20, yPosition, 190, yPosition);
  yPosition += 10;
  doc.setFontSize(12);
  doc.text(`Total Amount: ${purchase.totalAmount}`, 120, yPosition);

  // Notes
  if (purchase.notes) {
    yPosition += 20;
    doc.setFontSize(10);
    doc.text('Notes:', 20, yPosition);
    doc.text(purchase.notes, 20, yPosition + 10);
  }

  // Footer
  doc.setFontSize(8);
  doc.text('Purchase Order', 105, 270, { align: 'center' });

  // Save the PDF
  doc.save(`purchase-order-${purchase.id}.pdf`);
};
